webpackJsonp([0xc3046fbb5737],{2424:function(n,e){n.exports={pathContext:{docHtml:'<h1>Deep Extend</h1>\n<p>Recursive object extending.</p>\n<p><a href="https://nodei.co/npm/deep-extend/"><img src="https://nodei.co/npm/deep-extend.png?downloads=true&#x26;downloadRank=true&#x26;stars=true" alt="NPM"></a>\n<a href="https://nodei.co/npm/deep-extend/"><img src="https://nodei.co/npm-dl/deep-extend.png?height=3" alt="NPM"></a></p>\n<h2>Install</h2>\n<pre><code class="language-bash">$ npm install deep-extend\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-javascript">var deepExtend = require(\'deep-extend\');\nvar obj1 = {\n  a: 1,\n  b: 2,\n  d: {\n    a: 1,\n    b: [],\n    c: { test1: 123, test2: 321 }\n  },\n  f: 5,\n  g: 123,\n  i: 321,\n  j: [1, 2]\n};\nvar obj2 = {\n  b: 3,\n  c: 5,\n  d: {\n    b: { first: \'one\', second: \'two\' },\n    c: { test2: 222 }\n  },\n  e: { one: 1, two: 2 },\n  f: [],\n  g: (void 0),\n  h: /abc/g,\n  i: null,\n  j: [3, 4]\n};\n\ndeepExtend(obj1, obj2);\n\nconsole.log(obj1);\n/*\n{ a: 1,\n  b: 3,\n  d:\n   { a: 1,\n     b: { first: \'one\', second: \'two\' },\n     c: { test1: 123, test2: 222 } },\n  f: [],\n  g: undefined,\n  c: 5,\n  e: { one: 1, two: 2 },\n  h: /abc/g,\n  i: null,\n  j: [3, 4] }\n*/\n</code></pre>\n<h2>Unit testing</h2>\n<pre><code class="language-bash">$ npm test\n</code></pre>\n<h2>Changelog</h2>\n<p><a href="./CHANGELOG.html">CHANGELOG.md</a></p>\n<h2>Any issues?</h2>\n<p>Please, report about issues\n<a href="https://github.com/unclechu/node-deep-extend/issues">here</a>.</p>\n<h2>License</h2>\n<p><a href="./LICENSE">MIT</a></p>',docPath:"argo-ci/node_modules/fsevents/node_modules/deep-extend/readme",proj:"argo-ci"}}}});
